import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
// import App from './App';
import reportWebVitals from './reportWebVitals';
// our webpages works faster and stays offline
import Card from './card'; //for this, card.js was returning only signle file. i.e-> export default
import 'tachyons'; //our react wali bootstrap
import {robots} from './robots';//this is exporting >1 file, (it's an array) so that's why we
//are destructuring it by { }, because it's exporting const robs
//the one's which are not default, we have to destructure it to use.

ReactDOM.render(
  <React.StrictMode>
    <div>
      <Card id={Robot[0].id} name={Robot[0].name} email={Robot[0].email} />
      <Card id={Robot[1].id} name={Robot[1].name} email={Robot[1].email} />
      <Card id={Robot[2].id} name={Robot[2].name} email={Robot[2].email} />
    </div>
  </React.StrictMode>,
  document.getElementById('root')
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
